  function deleteItemAjax(url, header, parent, child, selector) {
    $.ajax({
      url: url,
      type: 'DELETE',
      dataType: 'json',
      success: function success(obj) {
        if (obj.success) {
          $(parent).children(child).each(function () {
            var templateId = $(this).attr('data-id');
            if (templateId == obj.data) {
              $(this).remove();
            }
          });
          if ($(parent).children(child).length <= 0) {
            $(selector).removeClass('d-none');
          }
        }
        swal({
          icon: 'success',
          title: Lang.get('messages.common.deleted') + ' !',
          text: header + Lang.get('messages.common.has_been_deleted'),
          type: 'success',
          buttons: {
            confirm: Lang.get('messages.common.ok')
          },
          reverseButtons: true,
          confirmButtonColor: '#F62947',
          timer: 2000
        });
        // if (callFunction) {
        //     eval(callFunction);
        // }
      },
      error: function error(data) {
        swal({
          icon: 'error',
          title: Lang.get('messages.common.error'),
          text: data.responseJSON.message,
          type: 'error',
          buttons: {
            confirm: Lang.get('messages.common.ok')
          },
          reverseButtons: true,
          confirmButtonColor: '#F62947',
          timer: 5000
        });
      }
    });
  }
