window.changeCountry = function (country, state) {
  $.ajax({
    url: route('states-list'),
    type: 'get',
    dataType: 'json',
    data: {
      postal: $(country).val()
    },
    success: function success(data) {
      $(state).empty();
      if (data.data.length != 0) {
        $.each(data.data, function (i, v) {
          $(state).append($('<option></option>').attr('value', i).text(v));
        });
      } else {
        $(state).append($('<option value=""></option>').text(Lang.get('messages.company.select_state')));
      }
      $(state).trigger('change');
    }
  });
};
window.changeState = function (country, state, city) {
  $.ajax({
    url: route('cities-list'),
    type: 'get',
    dataType: 'json',
    data: {
      state: $(state).val(),
      country: $(country).val()
    },
    success: function success(data) {
      $(city).empty();
      if (data.data.length != 0) {
        $.each(data.data, function (i, v) {
          $(city).append($('<option></option>').attr('value', i).text(v));
        });
      } else {
        $(city).append($('<option value=""></option>').text(Lang.get('messages.company.select_city')));
      }
    }
  });
};
function renderEducationTemplate(educationArray) {
  var candidateEducationCount = $('.candidate-education-container .candidate-education:last').data('education-id') != undefined ? $('.candidate-education-container .candidate-education:last').data('experience-id') + 1 : 0;
  var template = $.templates('#candidateEducationTemplate');
  var data = {
    candidateEducationNumber: candidateEducationCount,
    id: educationArray.id,
    degreeLevel: educationArray.degree_level.name,
    degreeTitle: educationArray.degree_title,
    year: educationArray.year,
    country: educationArray.country,
    institute: educationArray.institute
  };
  var stageTemplateHtml = template.render(data);
  $('.candidate-education-container').prepend(stageTemplateHtml);
  $('#notfoundEducation').addClass('d-none');
}
;
