  urlValidation(facebookUrl, facebookExp);
  urlValidation(twitterUrl, twitterExp);
  urlValidation(linkedInUrl, googlePlusExp);
  urlValidation(googlePlusUrl, linkedInExp);
  urlValidation(pinterestUrl, pinterestExp);
